import React from "react";

class ShowUrls extends React.Component {
    renderRow = (url) => {
        return <tr>
            <td><a href={url} /></td>
        </tr>
    }

    render() {
        let urlList = this.props.urlList;
        if (urlList) {
            console.log("showing table");
            return <table>
                {this.props.urlList.map(this.renderRow)}
            </table>
        }
    }
}

export default ShowUrls;
